import styled from 'styled-components';

const ProductsMainPageStyles = styled.section`
  position: relative;

  padding-top: 5rem;
  background: lightgray;
  margin-bottom: 10rem;

  h2 {
    font-size: 4rem;
    text-transform: uppercase;
    font-weight: 400;
  }


`;

export { ProductsMainPageStyles };
